    <style>
        @page {

            padding: 0;
            background: white;

            overflow: hidden;

            position: absolute;
            left: 50%;
            top: 50%;

        .edit-overlay, .page-delete-btn {
            display: none !important;

        @media print {
            body {
                width: 210mm;
                height: 297mm;
                background: none;
            }
            .a4-page {
                box-shadow: none;
                margin: 0;
                padding: 0;
            }
            .photo-placeholder {
                border: none;
            }
        }
    </style>
